                set v_fecha = concat(v_fecha, '|' , v_fecha);
                set v_recibo = concat(v_nro_recibo , '-' , v_nro_recibo);
                set v_monto_pag = ifnull(v_monto_pag, 0) + v_monto_pag;
        end if;
      UNTIL done  END REPEAT;
       CLOSE cursor_cobros;

       UPDATE Ctas_cobrar
     SET Ctas_cobrar.nro_recibos = ifnull(v_recibo, ''),
