         Ctas_cobrar.nro_factura = new.nro_documento and
         Ctas_cobrar.Nro_cuota = new.nro_cuota and
         Ctas_cobrar.cod_cliente = (select cod_cliente from cobros_clientes where nro_cobro=new.nro_cobro limit 1);


