DROP TABLE IF EXISTS `factura_proveedor`;
CREATE TABLE `factura_proveedor` (
  `nro_factura` varchar(18) NOT NULL DEFAULT '0',
  `fecha_factura` date NOT NULL,
  `saldo` decimal(12,0) NOT NULL DEFAULT '0',
  `estado` int(11) DEFAULT NULL,
  `total_exentas` float NOT NULL DEFAULT '0',
  `total_descuentos` float NOT NULL DEFAULT '0',
  `total_gravadas_10` float NOT NULL DEFAULT '0',
  `total_gravadas_5` float NOT NULL DEFAULT '0',
  `total_factura` float NOT NULL DEFAULT '0',
  `observaciones` mediumtext,
  `nro_registro` decimal(10,0) NOT NULL,
  `cod_persona` decimal(6,0) NOT NULL,
  `cod_tipo_comprobante` decimal(3,0) NOT NULL,
  `cod_moneda` decimal(10,0) NOT NULL DEFAULT '1',
  `cod_condicion` decimal(10,0) NOT NULL,
  `nro_oc` int(11) DEFAULT NULL,
  `iva_incluido` int(11) NOT NULL DEFAULT '0',
  `tipo_cambio` decimal(10,0) NOT NULL DEFAULT '0',
  `entrega_inicial` decimal(10,0) NOT NULL DEFAULT '0',
  `cant_cuotas` decimal(10,0) NOT NULL DEFAULT '0',
  `inicio_vence` decimal(10,0) NOT NULL DEFAULT '0',
  `dias` int(11) NOT NULL DEFAULT '0',
  `usuario` varchar(20) DEFAULT NULL,
  `cod_deposito` decimal(2,0) DEFAULT NULL,
  `cod_plazo` smallint(6) NOT NULL,
  `fecha` date NOT NULL,
  `costo_bruto_add` float NOT NULL DEFAULT '0',
  `valor` float DEFAULT NULL,
  `fecha_llegada` date DEFAULT NULL,
  `nro_recepcion` float NOT NULL DEFAULT '0',
  `total_impuesto_5` float NOT NULL DEFAULT '0',
  `total_impuesto_10` float NOT NULL DEFAULT '0',
  `descuento` float NOT NULL DEFAULT '0',
  `contabilizado` smallint(5) NOT NULL DEFAULT '0',
  `timbrado` varchar(25) NOT NULL DEFAULT '0',
  `vto_timbrado` date DEFAULT NULL,
  `fecha_alta` date DEFAULT NULL,
  PRIMARY KEY (`nro_registro`),
  KEY `inx_fk_factura_proveedor` (`cod_persona`) USING BTREE,
  KEY `FK_factura_proveedor_oc` (`nro_oc`),
  KEY `FK_factura_proveedor_dep` (`cod_deposito`),
  KEY `FK_factura_proveedor_cod_plazo` (`cod_plazo`),
  KEY `inx_fk_factura_proveedor_tipo_comp` (`cod_tipo_comprobante`) USING BTREE,
  KEY `inx_fact_tipo_com_prov` (`nro_factura`,`cod_persona`,`cod_tipo_comprobante`),
  KEY `inx_pk_factura_proveedor` (`nro_factura`,`cod_persona`) USING BTREE,
