--
-- Definition of function `f_precio_cliente`
--

DROP FUNCTION IF EXISTS `f_precio_cliente`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` FUNCTION `f_precio_cliente`(v_cod_cliente decimal(6),v_condicion decimal(6),v_cod_producto decimal(6)) RETURNS float
BEGIN
        declare v_lista_precio integer;
        declare v_impuesto integer;
        declare v_imp_imp integer;
        declare v_tipo_precio integer;
        declare v_impuesto_inc integer;
        declare v_precio float;

        SELECT ifnull(Clientes.tipo_precio,1) into v_tipo_precio FROM Clientes   WHERE Clientes.Cod_cliente = v_cod_cliente;
        if v_tipo_precio = 1 then
                SELECT ifnull(Clientes.nro_lista,0) into v_lista_precio FROM Clientes  WHERE Clientes.Cod_cliente = v_cod_cliente;

        else
                set v_lista_precio = 1;
        End if;

        SELECT precio_venta into v_precio from lista_precios_det WHERE cod_producto=v_cod_producto and nro_lista = v_lista_precio;
        SELECT iva_inc  into v_impuesto_inc from lista_precios_det WHERE cod_producto=v_cod_producto and nro_lista = v_lista_precio;
        SELECT tipo_iva.porcentage_iva*100 into v_imp_imp FROM Productos, Tipo_iva  where productos.cod_tipo_iva=tipo_iva.cod_tipo_iva and cod_producto = v_cod_producto ;
        if v_impuesto_inc <> 0 then
                set v_precio = v_precio /(v_imp_imp / 100 + 1);
        end if;
        return v_precio;

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

