INSERT INTO `recetas` (`cod_receta`,`descripcion_receta`,`cod_producto`,`modo_preparacion`,`notas`,`porc_beneficio`,`costo_mano_obra`,`costo_total_insumos`,`costo_instalacion`,`costo_total_producto`,`precio_venta`,`foto`,`fecha_alta`) VALUES 
 (4,'PIZZA','2732','Mezclar todos los ingredientes hasta lograr una masa sedosa (el agua varia) hasta  lograr una masa blanda.\r\n Dejar descansar la masa 15 minutos, tapada con un nylon. Cortar trozos de masa de 350 gramos y \r\nhacer bollos redondos y colocarlos, en pizzeras previamente pintadas con aceite, dejar tapado con un nylon. \r\nCuando los bollos duplicaron su tamaño, estirar con la punta de los dedos, hasta cubrir con la masa la\r\n totalidad de la pizzera, dejar levar, cuando la masa ya levo poner la salsa de tomate condimentada y \r\nla muzzarella rallada sobre la masa. Cocinar en horno moderado a 180º por 30 minutos aproximadamente.\r\n',NULL,0,'0','2417','0','2417','2417',NULL,'2011-09-25'),
 (5,'PAN ALEMAN','2733','Mezclar todos los ingredientes hasta lograr una masa sedosa (el agua varia) hasta  lograr una masa blanda.\r\n Dejar descansar la masa 15 minutos, tapada con un nylon. Cortar trozos de masa de 350 gramos y hacer bollos \r\nredondos y colocarlos, en pizzeras previamente pintadas con aceite, dejar tapado con un nylon. Cuando los \r\nbollos duplicaron su tamaño, estirar con la punta de los dedos, hasta cubrir con la masa la totalidad de la\r\n pizzera, dejar levar, cuando la masa ya levo poner la salsa de tomate condimentada y la muzzarella rallada \r\nsobre la masa. Cocinar en horno moderado a 180º por 30 minutos aproximadamente.',NULL,0,'0','2542','0','2542','2542',NULL,'2011-10-26'),
 (6,'PAN DULCE 1 KL.','1728','Disolver la levadura con la cucharada de azúcar, un poco de agua y dos cucharadas de harina;\r\ndejar descansar hasta que adquiera el doble de su volumen.\r\nTamizar la harina con el azúcar hasta que quede bien fina; hacer un hueco en el centro y \r\ncolocar la manteca, el extracto, la ralladura de naranja y el agua; amasar hasta lograr una masa\r\nhomogénea, lisa y suave.Se debe dejar levar hasta por lo menos el doble de su volumen inicial; agregar los frutos secos\r\ny amasar hasta mezclar. Colocar en un molde previamente enmantecado y enharinado; dejar levar nuevamente.Pincelar con huevo batido por encima y hornear durante 40 minutos, al retirar decorar con unos hilos de glace y frutos secos.',NULL,0,'0','941','0','941','0',NULL,'2011-10-25');
